import React, {useState, useCallback} from "react";
import {useDropzone} from 'react-dropzone'

import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';


const Upload_Resume = () => {
  const [isEnlarged, setIsEnlarged] = useState(false);

  const onDrop = useCallback(acceptedFiles => {
    // Do something with the files
  }, [])
  const {getRootProps, getInputProps, isDragActive} = useDropzone({onDrop})

  const handleClick = () => {
    setIsEnlarged(!isEnlarged); // Toggle the enlarged state
  };

  const pages = [
    {
      title: 'Page 1',
      content: (
        <div>
          <h2>file Overview</h2>
        <ul>
          <li>file name: {fileInfo.name}</li>
          <li>file size: {fileInfo.size}</li>
          <li>file type: {fileInfo.type}</li>
        </ul>
        </div>
      ),
    },
    {
      title: 'Page 2',
      content: (
        <div>
          <h2>select primary label column</h2>
          <form>
              {fileCols.map((item, index) => (
                <div key={index}>
                  <label>
                    <input
                      type="checkbox"
                      name={`${item}`}
                      checked={checkedLabels[`${item}`] || false}
                      onChange={handleLabelSelected}
                    />
                    {item}
                  </label>
                </div>
              ))}
            </form>
        </div>
      ),
    },
    {
      title: 'Page 3',
      content: (
        <div>
          <h2>select other label columns</h2>
          <form>
              {fileCols.map((item, index) => (
                <div key={index}>
                  <label>
                    <input
                      type="checkbox"
                      name={`${item}`}
                      checked={checkedMetadata[`${item}`] || false}
                      onChange={handleMetadataSelected}
                    />
                    {item}
                  </label>
                </div>
              ))}
            </form>
        </div>
      ),
    },
    {
      title: 'Page 4',
      content: (
        <div>
          <h2>select feature columns</h2>
          <button style = {{marginBottom: 10}}onClick={handleToggleAll}>Select All</button>
          <form>
          {featureCols.map(item => (
            <div>
            <label key={item}>
              <input
                type="checkbox"
                checked={checkedFeatures[item]}
                onChange={() => handleCheckboxChange(item)}
              />
              {item}
            </label>
            </div>
      ))}
            </form>
        </div>
      ),
    },
    {
      title: 'Page 5',
      content: (
        <div>
          <form>
          <label htmlFor="custom-dataset-name">custom dataset name:</label>
          <input className="custom-dataset-name-input"
            type="text"
            id="custom-dataset-name"
            name="custom-dataset-name"
            placeholder="Enter a custom name for your dataset"
            value={customDatasetName}
            onChange={(e) => setCustomDatasetName(e.target.value)}
          />
          </form>



        </div>
      ),
    },


    // Add more pages as needed
  ];


	return (
      <div>
        <div className={`dynamic-menu ${isEnlarged ? 'dynamic-menu-enlarged' : ''}`}>
        <button className={`upload-resume-btn ${isEnlarged ? 'hidden-btn' : ''}`} onClick={handleClick}>upload your resume</button>
        <div {...getRootProps()}>
      <input {...getInputProps()} />
      {
        isDragActive ?
          <p>Drop the files here ...</p> :
          <p>Drag 'n' drop some files here, or click to select files</p>
      }
    </div>
        </div>
      </div>
	);
};

export default Upload_Resume;
